import { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Planner() {
  const navigate = useNavigate();
  const HandleGoToTrackingClick = function () {
    navigate("/tracking");
  };
  //On page load, the current workout plan should be loaded (GET request to "/user" and check currentWorkoutPlanActive field).
  //Then, get the workout plan and the workouts (GET to "/workout_plan")
  return (
    <>
      <h1>Planner</h1>
      {/*7 evenly spaced out cards */}

      <div className="container-fluid">
        <div className="row">
          <div className="col-md">
            <h1>Monday</h1>
          </div>
          <div className="col-md">
            <h1>Tuesday</h1>
          </div>
          <div className="col-md">
            <h1>Wednesday</h1>
          </div>
          <div className="col-md">
            <h1>Thurday</h1>
          </div>
          <div className="col-md">
            <h1>Friday</h1>
          </div>
          <div className="col-md">
            <h1>Saturday</h1>
          </div>
          <div className="col-md">
            <h1>Sunday</h1>
          </div>
        </div>
      </div>
      <button id="LoadWorkoutPlanButton">Load workout plan</button>
      <button onClick={HandleGoToTrackingClick}>Go to tracking</button>
    </>
  );
}
